  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Squaw Creek National
  Wildlife Refuge outlines Refuge accomplishments for September through December of
  1942. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, furbearers, predators, rodents, raptors, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  plantings. Resource management is outlined; topics include haying and fur harvesting.
  The public relations section of the report describes recreational uses, hunting,
  fishing, violations, and Refuge visitors. Photographs and N-R forms are attached.\",\n\t\"owner_org\":
